import globalData from './global'; // 全局参数
import Toast from '../static/vant/toast/toast';
import { nullToStr } from './index.js';
function request(url, method, data, needLoading, header = {}) {
    if(!needLoading) {
        wx.showLoading({
            mask: true,
            title: '加载中' // 数据请求前loading
        });
    }
    return new Promise((resolve, reject) => {
        let header = {
            'content-type': 'application/json', // 默认值
            'CmpCode': globalData.windowData.CmpCode,
            'LsCustMode': globalData.windowData.LsCustMode,
            'LsAppCode': globalData.windowData.LsAppCode,
        };
        if(globalData.windowData.Token) {
            header['Token'] = globalData.windowData.Token;
        }
        if(globalData.windowData.UserId) {
            header['UserId'] = globalData.windowData.UserId;
        }
        wx.request({
            url: globalData.windowData.Host + url, // 接口地址
            method: method,
            data: data,
            header: header,
            success: function(res) {
                console.log(data);
                console.log(res);
                if(!needLoading) {
                    wx.hideLoading();
                }
                // 接口拦截
                if(res.statusCode == 404 || res.statusCode == 409) {
                    Toast.fail('数据返回异常，请退出重新登录');
                } else {
                    resolve(nullToStr(res.data));
                }
            },
            fail: function(res) {
                wx.hideLoading();
                // reject(false)
            },
            complete: function() {
                if(!needLoading) {
                    wx.hideLoading();
                }
            }
        });
    });
}
